    # Check if it is possible to escape
    safe = False
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                safe = True
                break

    if not safe:
        return "NOT POSSIBLE"

    # Initialize variables
    best_zones = 0
    zones_to_visit = []

    # Check if it is possible to escape from the S tile
    safe_neighbors = [[1, 0], [-1, 0], [0, 1], [0, -1]]
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S' and grid[i][j+1] == '0':
                for direction in safe_neighbors:
                    x, y = i + direction[0], j + direction[1]
                    if 0 <= x < N and 0 <= y < M and grid[x][y] == '0':
                        zones_to_visit.append((x, y))

    # Breadth-first search
    def dfs(x, y):
        nonlocal best_zones, zones_to_visit
        if x == -1 and y == -1:
            if len(zones_to_visit) > best_zones:
                best_zones = len(zones_to_visit)
            return

        # Traverse the current tile
        for direction in safe_neighbors:
            x, y = x + direction[0], y + direction[1]
            if 0 <= x < N and 0 <= y < M and grid[x][y] == '0':
                grid[x][y] = '1'
                dfs(x, y)
                grid[x][y] = '0'

    # Start the search
    dfs(0, 0)

    return str(best_zones)

