        polygons.append([coordinates[i], coordinates[(i + 1) % N], coordinates[(i + 2) % N]])

    polygons.sort(key=lambda x: x[0][0])

    res = []
    for polygon in polygons:
        if polygon[0][0] <= 0 and polygon[0][1] <= 0:
            continue

        x, y = polygon[0]
        dx, dy = x[1] - x[0], y[1] - y[0]
        area = dy * (polygon[1][0] - polygon[0][0]) - dx * (polygon[1][1] - polygon[0][1])

        area_error = abs(area - A) / A
        if area_error > 10 ** -4:
            continue

        if abs(dx) >= 10 ** -4 or abs(dy) >= 10 ** -4:
            res.append(polygon)
            continue

        # We can use the quadrant-crossing formulas to simplify the polygon
        x_min, y_min = min(x, polygon[0]) - 10 ** -4, min(y, polygon[0]) - 10 ** -4
        x_max, y_max = max(x, polygon[0]) + 10 ** -4, max(y, polygon[0]) + 10 ** -4

        y_axis_crossing = (x_max - x_min) * y_min - (x_max - x_min) * (y_max + y_min) > 0
        x_axis_crossing = (y_max - y_min) * x_min - (y_max - y_min) * (x_max + x_min) > 0

        if not x_axis_crossing or not y_axis_crossing:
            continue

        # We can rotate and skew the polygon as required
        if x_axis_crossing:
            for i, point in enumerate(polygon):
                if x_min <= point[0] <= x_max:
                    if y_max <= point[1] <= y_min:
