        if seats[i][j] == '.':
            hands += backtrack(i, j, m + 1, n, hands, x, y)
            hands += backtrack(i, j, m - 1, n, hands, x, y)
            hands += backtrack(i, j, m, n + 1, hands, x, y)
            hands += backtrack(i, j, m, n - 1, hands, x, y)
        if i!= x or j!= y:
            hands += backtrack(i, j, m, n, hands, x, y + 1)
            hands += backtrack(i, j, m, n, hands, x, y - 1)
            hands += backtrack(i + 1, j, m, n, hands, x + 1, y)
