            else:
                key[i][j] = ord(key_char)

    # Create the $5 by $5$ table
    table = [[0] * 5 for _ in range(5)]
    for i in range(5):
        for j in range(5):
            # Check if the letters are the same
            if key[i][j] == key[i][i]:
                table[i][j] = ord('X')
            # Check if the letters are on the same row
            elif key[i][j] == key[i][j-1] + 1:
                table[i][j] = key[i][j-1] + 1
            # Check if the letters are on the same column
            elif key[i][j] == key[i+1][j]:
                table[i][j] = key[i+1][j] + 1
            # Check if the letters are on the same diagonal
            elif key[i][j] == key[i+1][j+1]:
                table[i][j] = key[i+1][j+1] + 1
            # If the letters are not on the same diagonal or row, replace with the letters on the same diagonal or row
            else:
                if i == 0 or i == 4:
                    if j == 0:
                        table[i][j] = key[i+1][j+1] + 1
                    else:
                        table[i][j] = key[i-1][j-1] + 1
                elif j == 0:
                    table[i][j] = key[i+1][j-1] + 1
                else:
                    table[i][j] = key[i-1][j+1] + 1

    # Encrypt the plaintext
    ciphertext = []
    for i in range(len(plaintext)):
        encrypted = ''
        # Remove all spaces
        for j in range(len(plaintext[i])):
            if plaintext[i][j]!='':
                encrypted += plaintext[i][j]
        # Encrypt the digraphs
        for j in range(len(encrypted)):
            for k in range(len(encrypted) - j):
                if encrypted[j] == encrypted[k]:
                    encrypted = encrypted[:k] + encrypted[k+1:] + encrypted[k+2:]
                    break
        # Apply the rule
        for j in range(len(encrypted)):
            if encrypted[j] in ('A', 'E', 'I', 'O', 'U'):
                if j > 0 and encrypted[j] == encrypted[j-1]:
                    encrypted = encrypted[:j] + encrypted[j] + encrypted[j+1:]
                elif j > 1 and encrypted[j] == encrypted[j-2]:
                    encrypted = encrypted[:j] + encrypted[j] + encrypted[j+1:]
            elif encrypted[j] in ('B', 'C', 'D', 'F', 'G', 'H', 'J', 'K', 'L', 'M', 'N', 'P', 'Q', 'R', 'S', 'T', 'V', 'W', 'X', 'Y', 'Z'):
                if j > 0 and encrypted[j] == encrypted[j-1]:
                    encrypted = encrypted[:j] + encrypted[j] + encrypted[j+1:]
                elif j > 1 and encrypted[j] == encrypted[j-2]:
                    encrypted = encrypted[:j] + encrypted[j] + encrypted[j+1:]
        # Add the encrypted digit
